// client/src/pages/Login.jsx
import React, { useState, useEffect } from "react";
import "particles.js";
import axios from "axios";

const Login = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');

  useEffect(() => {
    // Load particles.js config
    window.particlesJS("particles-js", {
      particles: {
        number: { value: 80, density: { enable: true, value_area: 800 } },
        color: { value: "#00ffff" },
        shape: { type: "circle" },
        opacity: { value: 0.5 },
        size: { value: 3 },
        line_linked: { enable: true, color: "#00ffff", opacity: 0.4 },
        move: { enable: true, speed: 2 }
      },
      interactivity: {
        events: {
          onhover: { enable: true, mode: "repulse" },
          onclick: { enable: true, mode: "push" }
        }
      },
      retina_detect: true
    });
  }, []);

  const handleLogin = async (e) => {
    e.preventDefault();
    try {
      const res = await axios.post('https://api-fable-forest.onrender.com/api/auth/login', { email, password });
      localStorage.setItem('token', res.data.token);
      window.location.href = '/user';
    } catch (err) {
      alert('Login failed. Check email/password.');
    }
  };

  return (
    <div style={{
      position: "relative",
      width: "100vw",
      height: "100vh",
      overflow: "hidden",
      backgroundColor: "#000",
      fontFamily: "'Orbitron', sans-serif"
    }}>
      <div id="particles-js" style={{
        position: "absolute",
        width: "100%",
        height: "100%",
        zIndex: 0
      }}></div>

      <div style={{
        position: "relative",
        zIndex: 1,
        width: "360px",
        margin: "0 auto",
        top: "15%",
        padding: "30px",
        borderRadius: "12px",
        border: "2px solid #00ffff",
        backgroundColor: "rgba(0, 0, 0, 0.4)",
        boxShadow: "0 0 20px #00ffff",
        textAlign: "center",
        color: "#fff"
      }}>
        <h2 style={{
          fontSize: "32px",
          color: "#00ffff",
          marginBottom: "10px",
          textShadow: "0 0 8px #00ffff"
        }}>LOGIN</h2>
        <p style={{ fontSize: "16px", marginBottom: "20px", color: "#ccc" }}>Welcome Back</p>

        <form onSubmit={handleLogin}>
          <div style={{ marginBottom: "20px", textAlign: "left" }}>
            <label style={{ display: "block", marginBottom: "6px", fontSize: "14px", color: "#ccc" }}>Email</label>
            <input
              type="email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              required
              style={{
                width: "100%",
                padding: "10px 14px",
                fontSize: "15px",
                backgroundColor: "transparent",
                border: "1px solid #00ffff",
                borderRadius: "8px",
                color: "#fff",
                outline: "none",
                boxShadow: "0 0 8px #00ffff"
              }}
            />
          </div>

          <div style={{ marginBottom: "20px", textAlign: "left" }}>
            <label style={{ display: "block", marginBottom: "6px", fontSize: "14px", color: "#ccc" }}>Password</label>
            <input
              type="password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              required
              style={{
                width: "100%",
                padding: "10px 14px",
                fontSize: "15px",
                backgroundColor: "transparent",
                border: "1px solid #00ffff",
                borderRadius: "8px",
                color: "#fff",
                outline: "none",
                boxShadow: "0 0 8px #00ffff"
              }}
            />
          </div>

          <button type="submit" style={{
            width: "100%",
            padding: "12px",
            fontSize: "16px",
            backgroundColor: "transparent",
            border: "1px solid #00ffff",
            color: "#00ffff",
            borderRadius: "8px",
            cursor: "pointer",
            boxShadow: "0 0 10px #00ffff",
            transition: "background-color 0.3s ease, box-shadow 0.3s ease"
          }}>Sign In</button>

          <p style={{ marginTop: "16px", fontSize: "14px", color: "#ccc" }}>
            Don’t have an account? <a href="/register" style={{
              color: "#ff00ff",
              textDecoration: "none",
              fontWeight: "bold",
              textShadow: "0 0 6px #ff00ff"
            }}>Register</a>
          </p>
        </form>
      </div>
    </div>
  );
};

export default Login;
